from weightedNewick import Tree, buildTree, find

    # use find method
        # trace parents and record distances from parent
            # find LCA and add distances

def findDistance(tree: str, n1, n2):
    Tree.nameToNode = {}
    Tree.ids = 0
    root = buildTree(tree, (None, 0)) # root has no parent and 0 edge weight to its parent
    # print(Tree.nameToNode)
    node1 = find(n1)
    node1Parents = {}
    acc = 0
    # record the parents of n1 and distance from n1
    while node1 is not None:
        node1Parents[node1.name] = acc
        acc += node1.parent[1] # add cumulative weight to get to next parent
        node1 = node1.parent[0]
    # print(node1Parents)
    node2 = find(n2)
    # trace parents of n2 until we find a common parent with n1
    acc = 0
    while node2 is not None:
        if node2.name in node1Parents:
            return node1Parents[node2.name] + acc
        acc += node2.parent[1]
        node2 = node2.parent[0]
    return None



def solution(inpt: str):
    inpt = [x for x in inpt.splitlines() if x != '']
    res = []
    for tree, nodes in list(zip(inpt[::2], inpt[1::2])):
        n1, n2 = nodes.split(" ")
        res.append(round(findDistance(tree, n1, n2)))
    print(*res)

